  true,\n\t\"url\": null,\n\t\"notes\": \"This dataset contain raw data files in kmz
  files (Google Earth georeference format). These files include volcanic vent locations
  and age, the distribution of fine-grained lacustrine sediments (which act as both
  a seal and an insulating layer for hydrothermal fluids), and post-Miocene faults
  compiled from the Idaho Geological Survey, the USGS Quaternary Fault database, and
  unpublished mapping. nIt also contains the Composite Common Risk Segment Map created
  during Phase 1 studies, as well as a file with locations of select deep wells used
  to interrogate the subsurface. \",\n\t\"license_title\": \"Creative Commons Attribution\",\n\t\"extras\":
